(4,	'19-0004',	'2019-01-10 12:00:41',	10,	'{\"id\": \"10\", \"degree\": \"\", \"lastName\": \"Kudrna\", \"createdAt\": \"2019-01-08 20:08:55\", \"deletedAt\": null, \"firstName\": \"Luboš \", \"description\": \"kudrna\", \"personalNumber\": \"006\"}',	5,	'{\"id\": \"5\", \"degree\": \"\", \"lastName\": \"Joura\", \"createdAt\": \"2019-01-08 20:08:55\", \"deletedAt\": null, \"firstName\": \"Richard \", \"description\": \"joura\", \"personalNumber\": \"057\"}',	'Servis',	'Objednat opravu u pana Zikmunda následujících položek:\n- Vysavač Makita - asi vadný vypínač\n- Vrtačka Makita - nefunguje - prohlédnout příčinu\nUmístění obou nářadí je v prostoru vedle provizorní šatny u sloupu s popisy odpadů. (info L. Karásek) ',	'2019-01-31 00:00:00',	NULL,	'[]',	NULL),
(5,	'19-0005',	'2019-01-11 07:44:21',	10,	'{\"id\": \"10\", \"degree\": \"\", \"lastName\": \"Kudrna\", \"createdAt\": \"2019-01-08 20:08:55\", \"deletedAt\": null, \"firstName\": \"Luboš \", \"description\": \"kudrna\", \"personalNumber\": \"006\"}',	5,	'{\"id\": \"5\", \"degree\": \"\", \"lastName\": \"Joura\", \"createdAt\": \"2019-01-08 20:08:55\", \"deletedAt\": null, \"firstName\": \"Richard \", \"description\": \"joura\", \"personalNumber\": \"057\"}',	'Servis',	'Nesvítí zářivkové svítidlo v prostoru pro skladování odpadu vedle provizorní šatny.\nProjít ostatní svítidla co nesvítí.\nDámské záchody světlo na čidlo vyřadit čidlo, ovládání pouze na klapku.\nNahlásit panu Zikmundovi.',	'2019-01-25 00:00:00',	NULL,	'[]',	NULL),
